import React, { Component } from 'react';
import csv from '../services/csv';

export default class SearchComponent extends Component {
   state = {
       cities: [],
     };
   componentDidMount() {
       const cities = Object.keys(csv);
       this.setState({cities: cities});
       console.log(cities);
   }
   printCitiesList = () => {
       const list = cities.map((city) => (
         <option
           key={ city }
           value={ city }
         >
           { city }
         </option>
       ));
       return list;
     };
   render() {
     return (
       <div>
           <p>Consulte o seu transporte: </p>
           <label htmlFor="city-1-input">
           Cidade Origem:
           <select
               data-testid="city-1-input"
               name="city-1"
               defaultValue="ARACAJU"
           >
               { this.printCurrenciesList() }
           </select>
           </label>
           <label htmlFor="city-2-input">
           Cidade Destino:
           <select
               data-testid="city-2-input"
               name="city-2"
               defaultValue="BELEM"
           >
               { this.printCurrenciesList() }
           </select>
           </label>
       </div>
     )
   }
}
